import '../App.js';
import React from 'react';
import Left from './Left.js'
import Vert from './vert.js'
import Right from "./Right.js"
import '../stylesheets/App.css';

class MainTable extends React.Component{
  render(){
    return (
        <div className="main">
            <Left updatePage = {this.props.updatePage} currPage={this.props.currPage} />
            <Vert />
            <Right updatePage = {this.props.updatePage} currPage={this.props.currPage} setCurrPage={this.props.setCurrPage} updateQuest={this.props.updateQuest} updateAnswers={this.props.updateAnswers} quest={this.props.quest} answers={this.props.answers} updateTags={this.props.updateTags} searchTag = {this.props.searchTag} isTag={this.props.isTag} stripTag = {this.props.stripTag}/>
        </div>
    );
  }
}
export default MainTable;
